import React from "react";

const Circle = () => (
  <div
    style={{
      padding: 10,
      marginBottom: 10,
      display: "inline-block",
      backgroundColor: "#ffffff",
      borderRadius: "50%",
      width: 64,
      height: 64
    }}
  />
);
export default Circle;
